import logo from './search.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">Jio HotStar</header>
      <div className="Search-bar">
        <input type="search" id="searchtext" placeholder='Search Movie Name'></input>
         <img src={logo} className="search-logo" alt="logo" />
      </div>
    </div>

  );
}

export default App;
